css:
atom-text-editor,
:host {
  background-color: #f8f8ff;
  color: #1561ac;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #e1e1e1;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #E0E0E0;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #adadad;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #f8f8ff;
  color: #777777;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #dfdfff;
  color: #4d4d4d;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: #ffffd7;
  color: #4d4d4d;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #adadad;
}
atom-text-editor .invisible,
:host .invisible {
  color: #1561ac;
}
atom-text-editor .cursor,
:host .cursor {
  color: #444;
}
atom-text-editor .cursor-line,
:host .cursor-line {
  background-color: #ffffd7;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #dfdfff;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #ffff00;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ccccff;
}
.source,
.text {
  color: #1d1f21;
}
.comment {
  color: #9E9E9E;
  font-style: italic;
}
.comment.documentation {
  color: #dd1144;
  font-style: normal;
}
.comment.documentation .punctuation.definition.comment {
  color: #dd1144 !important;
  font-style: normal;
}
.entity.name {
  color: #008080;
}
.keyword {
  font-weight: bold;
}
.keyword.control {
  color: #1d1f21;
}
.keyword.control.import {
  color: #008080;
  font-weight: normal;
}
.keyword.operator {
  color: #006fe0;
  font-weight: normal;
}
.storage {
  color: #1d1f21;
  font-weight: bold;
}
.storage.type {
  font-weight: normal;
}
.storage.type.function,
.storage.type.class,
.storage.type.interface {
  color: #800080;
  font-weight: bold;
}
.storage.type.primitive {
  color: #800080;
  font-weight: bold;
}
.storage.type.annotation {
  color: #616161;
  font-weight: normal;
  font-style: italic;
}
.constant {
  color: #008080;
}
.constant.character.entity {
  color: #1d1f21;
  font-weight: bold;
}
.constant.numeric {
  color: #099;
}
.constant.language {
  font-weight: bold;
}
.constant.other {
  color: #1d1f21;
}
.constant.enum {
  color: #002d7a;
}
.variable {
  color: #002d7a;
}
.variable.language {
  color: #212121;
  font-weight: bold;
}
.invalid.illegal {
  background-color: #F44336;
  color: #f8f8ff;
}
.string {
  color: #d14;
}
.string.regexp {
  color: #006fe0 !important;
  font-weight: bold;
}
.string.regexp .punctuation,
.string.regexp .keyword,
.string.regexp .constant {
  color: #006fe0;
}
.string.regexp .punctuation.definition.string,
.string.regexp .keyword.definition.string,
.string.regexp .constant.definition.string {
  color: #006fe0;
}
.string.regexp .source.ruby.embedded {
  color: #FF9800;
}
.string.other.link {
  color: #F44336;
}
.string .constant {
  color: #d14;
}
.punctuation {
  color: #212121;
}
.punctuation.inheritance {
  color: #008080;
}
.punctuation.definition.comment {
  color: #9E9E9E;
}
.punctuation.definition.string {
  color: #d14;
}
.punctuation.definition.variable {
  color: #002d7a;
}
.support.class,
.support.namespace,
.support.function {
  color: #008080;
}
.support.function.construct {
  color: #800080;
  font-weight: bold;
}
.support.property-name {
  font-weight: bold;
}
.entity.name.tag {
  color: #002d7a;
}
.entity.other.attribute-name {
  color: #008080;
}
.entity.inherited-class {
  color: #008080;
}
.meta.brace,
.meta.delimiter {
  color: #212121;
}
.meta.import .storage.modifier {
  color: #002d7a;
  font-weight: normal;
}
.meta.function-call,
.meta.arguments,
.meta.other {
  color: #008080;
}
.meta.method-call .method {
  color: #008080;
}
.meta.tag.structure .punctuation.tag,
.meta.tag.xml .punctuation.tag,
.meta.tag.block .punctuation.tag,
.meta.tag.inline .punctuation.tag {
  color: #002d7a;
}
.meta.tag.sgml .doctype,
.meta.tag.sgml .documentroot {
  color: #777777;
  font-style: italic;
  font-weight: normal;
}
.meta.tag.sgml .punctuation.tag {
  color: #777777;
}
.meta.tag.preprocessor .punctuation.tag,
.meta.tag.preprocessor .entity.tag {
  color: #b85c00;
}
.meta.tag.preprocessor .entity {
  color: #1d1f21;
}
.meta .punctuation.embedded {
  color: #b85c00 !important;
}
.none {
  color: #1561ac;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #4CAF50;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.css .entity.attribute-name,
.less .entity.attribute-name,
.scss .entity.attribute-name {
  font-weight: bold;
}
.js.source,
.js .storage.modifier {
  color: #002d7a;
}
.js .keyword.operator.new {
  color: #1d1f21;
  font-weight: bold;
}
.php .constant.other {
  color: #099;
}
.php .storage.type {
  font-weight: bold;
}
.yaml .entity.name {
  color: #1d1f21;
  font-weight: bold;
}
.java .storage.modifier {
  color: #800080;
  font-weight: normal;
}
.java .meta.class.identifier .storage.modifier {
  font-weight: bold;
}
.java .meta.class.inherited .storage.modifier,
.java .meta.class.implemented .storage.modifier {
  color: #1d1f21;
  font-weight: bold;
}
.java .storage.type {
  color: #008080;
}
.java .storage.type.primitive {
  color: #800080;
}
